/*   FLC_IN_POSTPROC_MODE          14   FL-C is in post processing mode                                               */
/*   FD_OFFSET_IN_PROGRESS         15   FD offset is in progress                                                      */
/*   FD_WLAN_TOO_LOW               16   For NRF: WLAN power is too low for acquisition.                               */
/*   FLC_EXAM_MANAGER_ACTIVE       17   FL-C is in mode Exam Manager                                                  */
