/*                                         Physposition:                                                              */
/*                                         1= Position 1, Pixel (0,0) in upper left corner (0°)                       */
/*                                         2= Position 2, Pixel (0,0) in upper right corner (90° clockwise)           */
/*                                         3= Position 3, Pixel (0,0) in lower right corner (180° clockwise)          */
/*                                         4= Position 4, Pixel (0,0) in lower left corner (270° clockwise)           */
/*                                                                                                                    */
/*   ACS_BEAM_ANGLE_ALPHA            101   Beam angle alpha of tube for NRF                                           */
/*   ACS_TUBE_ROT_VERTICAL           102   vertical rotation of tube for NRF                                          */
/*   ACS_BEAM_POS_X                  103                                                                              */
/*   ACS_BEAM_POS_Y                  104                                                                              */
