/*   ISOCENTER_LAENGS                24                                                                               */
/*   FFA_BEWEGUNG                    25                                                                               */
/*   ACS_SID_VALID_OR_INVALID        26    SID valid or invalid (in low cost systems there is no potentiometer to     */
/*                                          acquire the SID continuously, there are only two switches for upper and   */
/*                                          lower SID. If the tube is in between both positions, the collimators      */
