/*                                         Physposition:                                                              */
/*                                         1= Position 1, Pixel (0,0) in upper left corner (0°)                       */
/*                                         2= Position 2, Pixel (0,0) in upper right corner (90° clockwise)           */
/*                                         3= Position 3, Pixel (0,0) in lower right corner (180° clockwise)          */
