                                                                            /* of the curve is sent to the generator. */
     ACS_INT          dlbfreq;                                                                   /* Fluoro pulse rate */
     ACS_WORD         dosisdr;                                  /* Dose when kV is exceeded because of dose reduction */
     ACS_BYTE         doserate_index;                               /* factor for dose change while framerate changes */
     ACS_BYTE         dlpregaction;                        /* dose regulation while fluoro: 0: no regstop; 1: regstop */
     ACS_BYTE         filterdl;                                                                  /* Filter for fluoro */
