     ACS_INT            it_long_b;  /* X coordinate of isocenter B in table coordinate system (origin table head end) */
     ACS_INT            it_lat_b;   /* Y coordinate of isocenter B in table coordinate system (origin table head end) */
     ACS_INT            it_height_b;/* Z coordinate of isocenter B in table coordinate system (origin table head end) */
     ACS_INT            sisod_a;                                           /* Distance between Source and Isocenter A */
     ACS_INT            sisod_b;                                           /* Distance between Source and Isocenter B */
     ACS_INT            iso_world_x_a;                              /* isocenter X plane A in world coordinate system */
     ACS_INT            iso_world_y_a;                              /* isocenter Y plane A in world coordinate system */
     ACS_INT            iso_world_z_a;                              /* isocenter Z plane A in world coordinate system */
