                                               /* replaced by 2 dummies as soon as the new ACSOS is available that is */
                                                                            /* able to handle arrays of long integers */
     ACS_LINT           stand_priv[STAND_PRIV_LENGTH];   /* privat data of the stand. It is an array with 50 elements */
                                                          /* of long integer. It is correctly defined in axcs.h. Only */
                                                       /* the automatically generated document does not indicate that */
                                                                                                 /* this is an array. */
     ACS_FLOAT32        coord_sys_c_arm[COORD_SYS_C_ARM_LENGTH];       /* coordinate system of c-arm, located in tool */
                                                                                    /* center point (12 float values) */
     ACS_FLOAT32        coord_sys_c_arm_b[COORD_SYS_C_ARM_B_LENGTH];   /* coordinate system of c-arm plane B, located */
                                                                            /* in tool center point (12 float values) */
