     ACS_FLOAT32        coord_sys_patient[COORD_SYS_PATIENT_LENGTH];   /* patient coordinate system (12 float values) */
     ACS_FLOAT32        robot_axes[ROBOT_AXES_LENGTH];       /* for ARTIS zeego only: values of the six robot axes (6 */
