     ACS_DUMMY          dummy3;
     ACS_DUMMY          dummy4;
     ACS_DUMMY          dummy5;
     ACS_DUMMY          dummy6;
     ACS_DUMMY          dummy7;
     ACS_DUMMY          dummy8;
     ACS_DUMMY          dummy9;
