/*   ACS_ACSS_SID_SUFFICIENT     0x08     Is the SID value sufficient (large enough)?                                 */
/*   ACS_ACSS_ANGLE_A_RIGHT      0x10     Is the alpha beam angle righted?                                            */
/*   ACS_ACSS_ANGLE_B_RIGHT      0x20     Is the beta beam angle righted?                                             */
