/*                                        (within all perpendicular rotations,                                        */
/*                                        i.e. ( abs(rotation) + 3 ) % 90 ) <= 6)                                     */
/*                                                                                                                    */
/*   ACS_ACSS_NOT_DECENTERED     0x1000   Is the beam not decentered, or decentered ACSS is not disabled?             */
/*   ACS_ACSS_COLL_NOT_CALIBR    0x2000   Is collimator calibration not in progress?                                  */
