     ACS_INT           coll_width_offset;                 /* Offset of width collimation for asymmetrical collimation */
     ACS_INT           coll_iris_diameter;                                             /* Diameter of iris collimator */
     ACS_INT           coll_finger_pos;                                        /* Position of finger wedge collimator */
                                                                                               /* in surgery not used */
                                                                                                                        
     ACS_INT           coll_finger_angle;                                         /* Angle of finger wedge collimator */
                                                           /* In surgery used for angle of rectangle image collimator */
                                                                                                                        
     ACS_INT           coll_wedge1_pos;                                             /* Position of wedge collimator 1 */
                                                                                /* used for SLOT_LAMELLA_1 in surgery */
                                                                                                                        
     ACS_INT           coll_wedge1_angle;                                              /* Angle of wedge collimator 1 */
                                                                                    /* used SLOT_LAMELLA_1 in surgery */
                                                                                                                        
     ACS_INT           coll_wedge2_pos;                                             /* Position of Wedge collimator 2 */
                                                                                    /* used SLOT_LAMELLA_2 in surgery */
                                                                                                                        
     ACS_INT           coll_wedge2_angle;                                              /* Angle of wedge collimator 2 */
                                                                                    /* used SLOT_LAMELLA_2 in surgery */
                                                                                                                        
     ACS_DCOUNT        num_steppara;                                                     /* Number of step-parameters */
